import {  Image, Text, View} from 'react-native';
import styles from "../styles/style-ce-details"

export default function DetailsMat({route}){
    const {CE} = route.params;
    console.log(CE.skills)
    return(
        <View style={styles.container}>
            <Text style={styles.titre}>
                {CE.name}
            </Text>
            <Image style={styles.img} source={{uri : CE.extraAssets.charaGraph.equip[CE.id]}}/>

            <View style={styles.infos}>
                <Text style={styles.infosText}>{CE.skills[0].detail}</Text>
            </View>
            
        </View>
    )
}
